import React from 'react';
import { Jumbotron as Jumbo, Container, Row, Col } from 'react-bootstrap';
import styled from 'styled-components';
import projImage from './assets/Asset_2.png';

const Styles = styled.div`
  .jumbo {
    background-size: cover;
    background-color: #343a40;
    color: white;
    height: 200px;
    position: relative;
  }

`;


export const Jumbotron = () => (
    <Styles>
    <Jumbo fluid className="jumbo" > 
      <div className="overlay" bg="dark" ></div>
      <Container>
        <Row>
            <Col xs={12} md={8}>
                <h1>Mireya Rodriguez</h1>
                <p>Software developer with 5 year experience programming web and mobile applications.</p>
            </Col>
            <Col xs={6} md={4}>
            <img src={projImage} fluid />
            </Col>
       </Row>
      </Container>
    </Jumbo>
    </Styles>


)

